import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LandingPage from "./pages/LandingPage";
import RegistrationForm from "./pages/Registration"; // Import the registration form
import SignIn from "./pages/Signin";
import HomePage from "./pages/Home";
import Goals from "./pages/Goals";
import Progress from "./pages/Progress";
import LogFoodPage from "./pages/log break fast";  // Import the LogFoodPage component

import "./App.css";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/register" element={<RegistrationForm />} />
        <Route path="/signin" element={<SignIn />} />
        <Route path="/home" element={<HomePage />} />
        <Route path="/goals" element={<Goals />} />
        <Route path="/progress" element={<Progress />} />
        <Route path="/log-food" element={<LogFoodPage />} /> {/* New route for logging food */}
      </Routes>
    </Router>
  );
}

export default App;
